import React, { Component } from 'react'
import './TurkeySVGMap.css'

class Il extends Component {
	constructor(props) {
		super(props)
		this.state = {
			isHovering: false
		}

		// This binding is necessary to make `this` work in the callback
		this.pickProvince = this.pickProvince.bind(this)
		this.handleMouseHover = this.handleMouseHover.bind(this)
	}

	pickProvince(e) {
		console.log(this.props.plakakodu)
	}

	handleMouseHover(e) {
		this.props.maphoverlistener({
			status: !this.state.isHovering,
			iladi: this.props.iladi || null
		})
		this.setState(this.toggleHoverState)
	}
	toggleHoverState(state) {
		return {
			isHovering: !state.isHovering
		}
	}

	render() {
		return (
			<path
				onMouseEnter={this.handleMouseHover}
				onMouseLeave={this.handleMouseHover}
				d={this.props.svgdata}
				className="il"
				plakakodu={this.props.plakakodu}
				alankodu={this.props.alankodu}
				iladi={this.props.iladi}
				onClick={this.pickProvince}
			/>
		)
	}
}

